import React, { Component } from "react";
import { FlatList, Text, StyleSheet } from "react-native";

interface Person {
  id: number;
  firstName: string;
}

const rows: Array<Person> = [
    {idHabit:100,
    "nomHabit":"Pull de Noël",
    "imageHabit":"",
    "categorieHabit": "Pull"
  },
  {"idHabit":"101",
    "nomHabit":"T-shirt Nirvana",
    "imageHabit":"",
    "categorieHabit": "T-shirt"
  },
  {"idHabit":"102",
    "nomHabit":"Jean",
    "imageHabit":"",
    "categorieHabit": "Pantalon"
  },
  { id: 0, firstName: "Benoit" },
  { id: 1, firstName: "Bernard" },
  { id: 2, firstName: "Jean-Marc A" },
  { id: 3, firstName: "Jérôme" },
  { id: 5, firstName: "Jean-Marc S" },
  { id: 6, firstName: "Pierre-Alexandre" },
  { id: 7, firstName: "Edwige" },
  { id: 8, firstName: "Baptiste" },
  { id: 9, firstName: "Coralie" },
  { id: 10, firstName: "Christophe" },
  { id: 11, firstName: "Véronique" },
  { id: 12, firstName: "Pierrick" },
  { id: 13, firstName: "Liliana" },
];

export default class App extends Component {
  // This function MUST take an object with an "item" property, whose type corresponds to the list element
  renderItem = ({ item }: { item: Person }) => {
    return <Text style={styles.row}>{item.firstName}</Text>;
  };

  render() {
    return (
      <FlatList<Person>
        style={styles.container}
        data={rows}
        renderItem={this.renderItem}
        // FlatList keys must be strings
        keyExtractor={(item: Person) => item.id.toString()}
      />
    );
  }
}

const styles = StyleSheet.create({
  container: {
    marginTop: 48,
    flex: 1,
  },
  row: {
    fontSize: 18,
    padding: 10,
    marginBottom: 5,
    backgroundColor: "skyblue",
  },
});
